import React from "react";

function Aside() {
  return (
    <aside>
      <nav>
        <ul>
          <li><a href="#ferramenta1">Imagem</a></li>
          <li><a href="#ferramenta2">CSS</a></li>
          <li><a href="#ferramenta3">JSON</a></li>
        </ul>
      </nav>
    </aside>
  );
}

export default Aside;
